        title: 'Триггерный ретаргетинг (Retargeting Trigger Leads)',
        descr:
          'На сайт автодилера устанавливается легковесный код, который отслеживает поведение посетителей, анализирует их интерес к автомобилям и фиксирует триггерные события. Мы идентифицируем потенциальных клиентов, даже если они не оставили заявку, и передаем их контакты в CRM и используем для персонализированных звонков.',
